SET NAMES utf8mb4;

create database trevari_snapshot;

create table users
(
    created_at datetime(6)  null,
    updated_at datetime(6)  null,
    id         binary(16)   not null
        primary key,
    created_by varchar(255) null,
    password   varchar(255) not null,
    role       varchar(255) null,
    updated_by varchar(255) null,
    username   varchar(255) not null,
    constraint UKr43af9ap4edm43mmtq01oddj6
        unique (username)
);

create table publishers
(
    created_at datetime(6)  null,
    updated_at datetime(6)  null,
    id         binary(16)   not null
        primary key,
    created_by varchar(255) null,
    name       varchar(255) not null,
    updated_by varchar(255) null,
    constraint UKan1ucpx8sw2qm194mlok8e5us
        unique (name)
);

create table authors
(
    created_at datetime(6)  null,
    updated_at datetime(6)  null,
    id         binary(16)   not null
        primary key,
    created_by varchar(255) null,
    name       varchar(255) not null,
    updated_by varchar(255) null,
    constraint UK9mhkwvnfaarcalo4noabrin5j
        unique (name)
);


create table books
(
    created_at   datetime(6)  null,
    published    datetime(6)  null,
    updated_at   datetime(6)  null,
    author_id    binary(16)   null,
    id           binary(16)   not null
        primary key,
    publisher_id binary(16)   null,
    created_by   varchar(255) null,
    image        varchar(255) null,
    isbn         varchar(255) not null,
    subtitle     varchar(255) null,
    title        varchar(255) not null,
    updated_by   varchar(255) null,
    constraint UKkibbepcitr0a3cpk3rfr7nihn
        unique (isbn)
);



